@nerysvevo I don't really know mathematics either dw.

Ratio, in raw analytical terms, is basically used as a tool to show that what someone said is not as popular as its own opposition.
So if you post a bad take and it gets more replies and QRTs in disagreement than likes, that's a ratio.

